@mccalluc - Your second approach is what I was thinking of, and at some point it will also include Collection information (https://github.com/pulibrary/pdc_describe/issues/841)

```
{
  "resource": { ... existing fields ... },
  "work": { "files": ["file1.txt"] }
  "collection": // collection info
}
```

As you pointed out, for files we will need more than just the file name. You can see here what we do to import the files from DataSpace (https://github.com/pulibrary/pdc_discovery/blob/main/lib/traject/dataspace_research_data_config.rb#L393-L419). Here is an example XML of what we get from DataSpace (https://github.com/pulibrary/pdc_discovery/blob/main/spec/fixtures/astrophysical_sciences.xml) -- files are under `bitstreams`. We don't need an exact structure, but that should give you an idea of what we currently get. This is an example of how it looks on PDC Discovery https://datacommons.princeton.edu/discovery/catalog/155547.
